
/*
 * LCD 显示驱动模块
 * 基于SPI接口的128x128 LCD显示屏驱动
 * 
 * 功能：
 * - SPI接口初始化和数据传输
 * - LCD初始化和配置
 * - 像素数据写入（支持8/16/32位批量传输）
 * - 显示区域设置和填充
 * - 图像显示测试
 */

#include <firmware.h>
#include <tinyprintf.h>
#include <tinytim.h>
#include <tinygpio.h>
#include <tinylcd.h>

/**
 * @brief SPI接口初始化
 * 
 * 配置GPIO和QSPI控制器参数：
 * - 设置GPIO使能
 * - 配置QSPI状态、中断、时钟分频等
 */
void spi_init()
{
    reg_gpio_enb = (uint32_t)0b011;
    reg_cust_qspi_status = (uint32_t)0b10000;
    reg_cust_qspi_status = (uint32_t)0b00000;
    reg_cust_qspi_intcfg = (uint32_t)0b00000;
    reg_cust_qspi_dum = (uint32_t)0;
    reg_cust_qspi_clkdiv = (uint32_t)1; // sck = apb_clk/2(div+1)
    printf("gpio_enb: %x\n", reg_gpio_enb);
    printf("qspi_status: %x\n", reg_cust_qspi_status);
    printf("qspi_intcfg: %x\n", reg_cust_qspi_intcfg);
    printf("qspi_dum: %x\n", reg_cust_qspi_dum);
    printf("qspi_clkdiv: %x\n", reg_cust_qspi_clkdiv);
}

void spi_wr_dat(uint8_t dat)
{
    uint32_t wdat = ((uint32_t)dat) << 24;
    // spi_set_datalen(8);
    reg_cust_qspi_len = 0x80000;
    // spi_write_fifo(&wdata, 8);
    reg_cust_qspi_txfifo = wdat;
    // spi_start_transaction(SPI_CMD_WR, SPI_CSN0);
    reg_cust_qspi_status = 258;
    while ((reg_cust_qspi_status & 0xFFFF) != 1)
        ;
}

